import React from "react";

export const Login = () => {
  return (
    <div className="text-center">
      <h1>Login to My App</h1>
      <button className="btn btn-primary d-block">Login with Facebook</button>
      <button className="btn btn-primary d-inline-block">Login with Google</button>
    </div>
  );
};

export default Login;
